package Tree;import Temp.Temp;import Temp.Label;import java.util.List;import java.util.LinkedList;public class CALL extends Exp1 {    public Exp1 func;    public List<Exp1> args;    public CALL(Exp1 f, List<Exp1> a) { func=f; args=a; }    public LinkedList<Exp1> kids() {	LinkedList<Exp1> kids = new LinkedList<Exp1>();	kids.addFirst(func);	kids.addAll(args);	return kids;    }    public Exp1 build(LinkedList<Exp1> kids) {	return new CALL(kids.removeFirst(), kids);    }    public void accept(IntVisitor v, int d) { v.visit(this, d); }    public Temp accept(CodeVisitor v) { return v.visit(this); }    public <R> R accept(ResultVisitor<R> v) { return v.visit(this); }}